/* microinfer model */
static int8_t microinfer_input_data[3072];
static int8_t microinfer_output_data[10];
static microinfer_model_t* microinfer_model_create(void)
{
	static microinfer_model_t model;
	microinfer_layer_t ** layer = malloc(sizeof(microinfer_layer_t *)*35);
	if(NULL == layer) return NULL;

	new_model(&model);

	layer[0] = Input(shape(32, 32, 3), microinfer_input_data);
	layer[1] = model.hook(Conv2D(12, kernel(5, 5), stride(1, 1), dilation(1, 1), PADDING_SAME, &conv2d_w, &conv2d_b), layer[0]);
	layer[2] = model.active(act_relu(), layer[1]);
	layer[3] = model.hook(MaxPool(kernel(2, 2), stride(2, 2), PADDING_VALID), layer[2]);
	layer[4] = model.hook(Conv2D(12, kernel(3, 3), stride(1, 1), dilation(1, 1), PADDING_SAME, &conv2d_1_w, &conv2d_1_b), layer[3]);
	layer[5] = model.active(act_relu(), layer[4]);
	layer[6] = model.mergex(Concat(-1), 2 ,layer[3] ,layer[5]);
	layer[7] = model.hook(Conv2D(12, kernel(3, 3), stride(1, 1), dilation(1, 1), PADDING_SAME, &conv2d_2_w, &conv2d_2_b), layer[6]);
	layer[8] = model.active(act_relu(), layer[7]);
	layer[9] = model.mergex(Concat(-1), 3 ,layer[3] ,layer[5] ,layer[8]);
	layer[10] = model.hook(Conv2D(12, kernel(3, 3), stride(1, 1), dilation(1, 1), PADDING_SAME, &conv2d_3_w, &conv2d_3_b), layer[9]);
	layer[11] = model.active(act_relu(), layer[10]);
	layer[12] = model.mergex(Concat(-1), 4 ,layer[3] ,layer[5] ,layer[8] ,layer[11]);
	layer[13] = model.hook(Conv2D(12, kernel(3, 3), stride(1, 1), dilation(1, 1), PADDING_SAME, &conv2d_4_w, &conv2d_4_b), layer[12]);
	layer[14] = model.active(act_relu(), layer[13]);
	layer[15] = model.mergex(Concat(-1), 5 ,layer[3] ,layer[5] ,layer[8] ,layer[11] ,layer[14]);
	layer[16] = model.hook(Conv2D(36, kernel(1, 1), stride(1, 1), dilation(1, 1), PADDING_SAME, &conv2d_5_w, &conv2d_5_b), layer[15]);
	layer[17] = model.active(act_relu(), layer[16]);
	layer[18] = model.hook(MaxPool(kernel(2, 2), stride(2, 2), PADDING_VALID), layer[17]);
	layer[19] = model.hook(Conv2D(12, kernel(3, 3), stride(1, 1), dilation(1, 1), PADDING_SAME, &conv2d_6_w, &conv2d_6_b), layer[18]);
	layer[20] = model.active(act_relu(), layer[19]);
	layer[21] = model.mergex(Concat(-1), 2 ,layer[18] ,layer[20]);
	layer[22] = model.hook(Conv2D(12, kernel(3, 3), stride(1, 1), dilation(1, 1), PADDING_SAME, &conv2d_7_w, &conv2d_7_b), layer[21]);
	layer[23] = model.active(act_relu(), layer[22]);
	layer[24] = model.mergex(Concat(-1), 3 ,layer[18] ,layer[20] ,layer[23]);
	layer[25] = model.hook(Conv2D(12, kernel(3, 3), stride(1, 1), dilation(1, 1), PADDING_SAME, &conv2d_8_w, &conv2d_8_b), layer[24]);
	layer[26] = model.active(act_relu(), layer[25]);
	layer[27] = model.mergex(Concat(-1), 4 ,layer[18] ,layer[20] ,layer[23] ,layer[26]);
	layer[28] = model.hook(Conv2D(12, kernel(3, 3), stride(1, 1), dilation(1, 1), PADDING_SAME, &conv2d_9_w, &conv2d_9_b), layer[27]);
	layer[29] = model.active(act_relu(), layer[28]);
	layer[30] = model.mergex(Concat(-1), 5 ,layer[18] ,layer[20] ,layer[23] ,layer[26] ,layer[29]);
	layer[31] = model.hook(Conv2D(48, kernel(3, 3), stride(1, 1), dilation(1, 1), PADDING_SAME, &conv2d_10_w, &conv2d_10_b), layer[30]);
	layer[32] = model.hook(Dense(10, &dense_w, &dense_b), layer[31]);
	layer[33] = model.hook(Softmax(), layer[32]);
	layer[34] = model.hook(Output(shape(10,1,1), microinfer_output_data), layer[33]);
	model_compile(&model, layer[0], layer[34]);
	free(layer);
	return &model;
}
